import styled from "styled-components";

export const StyledForm = styled.form`
  .container {
    background: #0a192f;
    width: 700px;
    marg
  }
  .ele {
    border: 2px solid #1c283d;
    font-family: Lato;
    height: 55px;
    margin: 15px;
  }
  .eleS {
    background-color: #0a192f !important;
    border: none;
    padding: 9px;
    color: #5b7276;
    width: 600px;
    height: 50px;
  }
  .eleS:focus{
      outline:none;
  }
  .eleText {
    height: 185px;
  }
  .text {
    height: 190px;
  }
`;
